      if(key === `folder`) {
        continue
      }
    }

    Object.entries(file).map(([key, value]) => {
      return <File
        file={value}
      />
    })
  } else {
    console.log(`Else`)
  }

  return <>
    {file.type === `folder` ? <>

    </> : <>
      {`file`}
    </> }
  </>
}
